import React, {Component} from "react";
import "../Css/MapMarker.css"
import ReactMapGL, {Marker, Popup} from 'react-map-gl';



function MapMarker (props) {
    return(
                <div className="MapMarker">
                    <h1>{props.title}</h1>
                    <p>{props.desc}</p>
                </div>


    )
}

export default MapMarker;
